import math

def max_cuts(n, a, b, c):
    if n == 0:
        return 0
    elif n < 0:
        return -1
    result = max(max_cuts(n - a, a, b, c), max_cuts(n - b, a, b, c), max_cuts(n - c, a, b, c))
    if result == -1:
        return -1
    return result + 1

