from collections import Counter
t = int(input())
for _ in range(t):
    n = int(input())
    arr = [int(s) for s in input().split(' ')]
    count = Counter(arr)
    ans = list(sorted(count.keys()))
    for (key, value) in count.items():
        if value == 1:
            continue
        else:
            ans += [key] * (value - 1)
    print(' '.join(map(str, ans)))

